import React, { Component } from 'react';
import './Header.css'
import Logo from '../Header/img/E.svg';


class Header extends Component {
    render() {
        return (
            <div>
                <nav class="navbar navbar-expand-lg navbar-light bg-light">
                    <a class="navbar-brand" href="/">Elderly</a>
                    <div class="collapse navbar-collapse" id="navbarNav">
                        <ul class="navbar-nav px-md-5">
                            <li class="nav-item ">
                                <a class="nav-link px-md-2" href="#">Home</a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link px-md-2" href="#">Features</a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link px-md-2" href="#">Pricing</a>
                            </li>
                            
                        </ul>
                    </div>
                </nav>
            </div>
        );
    }

}
export default Header;
